(1, '10201', '. Despite ______ on taking rare tamarins from their habitat, the illegal trade in the tiny monkeys remains ______. ', 'commendations…obligatory', 'consultations…predominant', 'restrictions…local', 'penalties…illicit', 'prohibitions…active', NULL, NULL, NULL, NULL, 'ok'),
(2, '10202', 'Representing a round world on a flat surface is impossible without some ______: the Mercator projection map shows Greenland as over ten times larger that Mexico, a country in fact only slightly smaller than Greenland.', 'oversight', 'simplification', 'distortion', 'sophistication', 'superficiality', NULL, NULL, 'ok', NULL, NULL),
(3, '10203', 'The highly publicized redesign of the car is essentially______: the exterior has been update, but the engine remains unchanged.', 'intuitive', 'cosmetic', 'incoherent', 'consequential', 'retroactive', NULL, 'ok', NULL, NULL, NULL),
(4, '10204', 'Many of our memories are ______, escaping our consciousness just as we strain to recall a face or a name.', 'elusive', 'pervasive', 'unvaried', 'insensitive', 'impractical', 'ok', NULL, NULL, NULL, NULL),
(5, '10205', 'Although Caroline Gordon was rigorously objective in her journalistic writing, her lively and ______ private correspondence______ a delightful capacity for biting commentary on the social scene.', 'incisive…disguised', 'eloquent…derided', 'dispassionate…demonstrated', 'exuberant…minimized', 'entertaining…exhibited', NULL, NULL, NULL, NULL, 'ok'),
(6, '10206', 'An effective member of debating team must focus clearly on the ______ issue and avoid ______ arguments.', 'equivocal…obstreperous', 'designated…pertinent', 'comprehensive…general', 'principal…peripheral', 'subtle…significant', NULL, NULL, NULL, 'ok', NULL),
(7, '10207', 'The ______ with which merchants and landowners in early-nineteenth-century Maryland and Virginia ______ Joshua Johnston''s professional services attests to his artistic skill as a portrait painter.', 'avidness…sought', 'difference…purchased', 'patience…replaced', 'elegance…regarded', 'zealousness…overlooked', 'ok', NULL, NULL, NULL, NULL),
(8, '10208', 'The man''s colleagues characterized him as ______ because he had an irritable, quarrelsome disposition.', 'tyrannical', 'disingenuous', 'sanctimonious', 'cantankerous', 'morose', NULL, NULL, NULL, 'ok', NULL),
(9, '10501', 'After winning the lottery, John bought sports cars, built a mansion, and wore designer suits; however, by thus ______ his ______, he alienated his friends.', 'enduring…hardship', 'flaunting…prosperity', 'undermining…image', 'calculating…successes', 'moderating…consumption', NULL, 'ok', NULL, NULL, NULL),
(10, '10502', 'The study of biology, once considered the key to solving nature''s mysteries, has instead served to emphasize nature''s incredible ______.', 'tranquility', 'immobility', 'consistency', 'desirability', 'complexity', NULL, NULL, NULL, NULL, 'ok'),
(11, '10503', 'In 1575 Venetians instituted an annual celebration to _____ the end of the ______ that had struck the city.', 'lament…turmoil', 'commemorate…plague', 'eulogize…pestilence', 'hail…prosperity', 'solemnize…fame', NULL, 'ok', NULL, NULL, NULL),
