(14, '10801', 'Most pioneers ______ this valley on their journey to the West because its rugged terrain and frequent landslides made it a ______ place for travelers.', 'flanked…fascinating', 'avoided…necessary', 'encompassed…curious', 'enjoyed…troublesome', 'skirted…hazardous', NULL, NULL, NULL, NULL, 'ok'),
