(566, '80802', 'The hurricane was a ______ event, leaving in its wake millions of dollars in damage.', 'calamitous ', 'banal', 'minuscule', 'precipitous', 'heralded', 'ok', NULL, NULL, NULL, NULL),
(567, '80803', 'Weakened by his bout with pneumonia, Gary found himself virtually incapacitated, ______ to ______ the energy necessary to run a marathon. ', 'ardent…salvage', 'unable…muster', 'disinclined…squander', 'eager…exert ', 'hesitant…enervate ', NULL, 'ok', NULL, NULL, NULL),
(568, '80804', 'Despite her ______ schedule, Karen amazed everyone with her seemingly unlimited ______. ', 'episodic…vitality ', 'hectic…acuity', 'strenuous…alacrity ', 'busy…sanctity ', 'precise…energy', NULL, NULL, 'ok', NULL, NULL),
(569, '80805', 'The oracle at Delphi purposely made ______ prophecies so that they could be interpreted in more than one way. ', 'equivocal ', 'vacuous', 'mirthful', 'omnipotent', 'meager', 'ok', NULL, NULL, NULL, NULL),
(570, '80806', 'The lake was found to be so ______ that state environment officials were forced to investigate and temporarily ______ all recreational swimming and boating. ', 'placid…prohibit ', 'polluted…urge', 'brimming…evade', 'noxious…proscribe ', 'shallow…promote', NULL, NULL, NULL, 'ok', NULL),
(571, '90301', 'Great personal danger is one of the few things that will force a lion to relinquish its prey; carnivores will ______ a meal only at the point where self-preservation outweighs hunger.', 'consume', 'camouflage', 'forgo ', 'inspect', 'balance', NULL, NULL, 'ok', NULL, NULL),
(572, '90302', 'The miser was so afraid of losing money that he was willing to pass up a ______ opportunity rather than ______ what he already possessed.', 'profitable…earn', 'lucrative…risk', 'hazardous secure', 'shrew…waste', 'fortunate…discredit', NULL, 'ok', NULL, NULL, NULL),
(573, '90303', 'After the governor announced that she would refrain from smear tactics in the campaign, many expressed hope that this action would restore ______ to public discourse.', 'civility ', 'abstraction', 'monotony', 'partiality', 'tension', 'ok', NULL, NULL, NULL, NULL),
(574, '90304', 'Health experts have found that the use of antibiotics, while beneficial when used with ______, may actually be ______ in the long term.', 'constraint…advantageous', 'moderation…detrimental', 'dispatch…beneficial', 'excess…pernicious', 'exactness…excruciating ', NULL, 'ok', NULL, NULL, NULL),
(575, '90305', 'Some early American pioneers were so ______ to be beholden to others that they refused any favors or offers of help.', 'fervent', 'brazen', 'resolved', 'prudent', 'loath ', NULL, NULL, NULL, NULL, 'ok'),
(576, '90306', 'His parents fostered in him such a sense of self-worth that when he became a prisoner of war, the ______ treatment by his captors failed to make him feel ______.', 'genteel…humiliated', 'morose…bewildered', 'corrupt…praiseworthy ', 'demeaning…inferior', 'reverential…venerated', NULL, NULL, NULL, 'ok', NULL),
(577, '90307', 'Viki''s tendency to aggressively exaggerate her case was not to her advantage; her ______ manner often angered her superior.', 'overblown', 'callow', 'inane', 'refined', 'belligerent', 'ok', NULL, NULL, NULL, NULL),
(578, '90308', 'When the president''s misdeed was finally uncovered, the press called for his indictment, but he insisted that his action was merely a ______ which he need not have disclosed.', 'windfall', 'plot', 'lapse ', 'malfeasance', 'calamity', NULL, NULL, 'ok', NULL, NULL),
(579, '90701', 'One can argue that the scientific process is a constant, because despite numerous ______ in the instruments used, the steps that scientists follow have been ______ for centuries.', 'losses…converted', 'refinements…atypical', 'drawbacks…intact', 'advances…unaltered', 'improvements…unreliable', NULL, NULL, NULL, 'ok', NULL),
(580, '90702', 'Schubert exclaimed with ______ when he realized that the one ______ error he made in calculation had accidentally given him the solution he had been seeking for years. ', 'dismay…appalling', 'elation…significant', 'dread…involuntary', 'jubilation…intentional', 'exultation…audible', NULL, 'ok', NULL, NULL, NULL),
(581, '90703', 'The project manager ______ his presentation with an excessively optimistic outlook and flowery language in an effort to win director''s approval.', 'appeased', 'embellished', 'conceived', 'disdained', 'derived', NULL, 'ok', NULL, NULL, NULL),
(582, '90704', 'At the science fair, Joanna was stunned when what she thought was ______ entry received ______ score from the judges.', 'an outstanding…a differential', 'a blemished…a contemptible', 'a mediocre…a superlative', 'an extremist…atrocious', 'a laudable…a gratifying', NULL, NULL, 'ok', NULL, NULL),
(583, '90705', 'The prisoner''s looming execution date gave defense attorneys added ______ to analyze new DNA evidence that might exonerate their client.', 'discretion', 'certitude', 'acuity', 'enmity', 'impetus ', NULL, NULL, NULL, NULL, 'ok'),
(584, '90901', 'After the first week of the semester, students in the accounting course found the subject more ______ and thought-provoking than ______.', 'academic…scholarly', 'suspicious…gracious', 'interesting…intriguing ', 'riveting…wearisome', 'stale…interesting', NULL, NULL, NULL, 'ok', NULL),
(585, '90902', 'Considering Desiree''s ______ on the basketball court, it was surprising that her younger brother was so ______: whereas she moved with ease and skill, he was rather uncoordinated.', 'grace…superior', 'agility…clumsy', 'haughtiness…nimble', 'sportsmanship…temperamental', 'ineptitude…blundering', NULL, 'ok', NULL, NULL, NULL),
(586, '90903', 'Once relegated to only a few outlets such as television and radio, advertising now confronts us everywhere; it has become ______ presence in our lives.', 'an offensive ', 'an insensible', 'an urbane', 'a ubiquitous', 'an ineffective', NULL, NULL, NULL, 'ok', NULL),
(587, '90904', 'The conversation between the fierce competitors quickly degenerated from restrained and playful taunts to aggressively ______ insults.', 'vituperative', 'professional', 'inscrutable', 'noisome', 'vapid', 'ok', NULL, NULL, NULL, NULL),
(588, '90905', 'Although Sumi sincerely wanted her team to succeed, she refused to ______ her teammate''s plan to cheat during the championship game.', 'proscribe', 'hamper', 'obfuscate', 'endorse ', 'meander', NULL, NULL, NULL, 'ok', NULL),
(589, '90906', 'Though Nina believes her argument to be a ______ one, her verbose explanations and exclusive reliance on her own obscure experiences make it more ______ than she realize.', 'pithy…obtuse', 'passionate…insipid', 'petulant…approachable', 'strident…vociferous', 'tremulous…terse', 'ok', NULL, NULL, NULL, NULL),
(590, '100201', 'Although the student insisted his essay was an original, his teacher was ______, since she remembered reading the exact same paper last year.', 'circumspect', 'ambivalent', 'skeptical ', 'stoic', 'sanguine', NULL, NULL, 'ok', NULL, NULL),
(591, '100202', 'Marie was ______ to disappointment, having weathered numerous instances of ______.', 'imperceptive…affluence', 'unused…misfortune', 'habituated…contentment', 'accustomed…disillusionment ', 'resigned…beneficence', NULL, NULL, NULL, 'ok', NULL),
(592, '100203', 'Despite the fact that docudrama was not entirely ______, historians extolled its production as ______.', 'factual…meritorious', 'fabricated…specious', 'prodigious…exhaustive', 'theoretical…na.ve', 'coordinal…dogmatic', 'ok', NULL, NULL, NULL, NULL),
(593, '100204', 'Many fear that the ______ of more lenient rules regarding tobacco advertising could be detrimental to public health.', 'withdrawal', 'ratification', 'provocation ', 'elocution', 'elucidation', NULL, 'ok', NULL, NULL, NULL),
(594, '100205', 'In low-pressure air systems, clouds can contain large amounts of moisture, which allow them to ______ enough precipitation to make for damp and ______ weather.', 'produce…sunny', 'generate…inclement', 'advance…humid', 'agitate…chilly ', 'evaporate…foggy', NULL, NULL, 'ok', NULL, NULL),
(595, '100206', 'The coach does not expect his players to be ______, that is, lacking energy before an important game.', 'irksome', 'complacent ', 'listless ', 'idle', 'vital', NULL, NULL, 'ok', NULL, NULL),
(596, '100207', 'Professional critics derided the actor''s performance as lacking subtlety and depth, and predicted that his fame would be ______. ', 'esoteric', 'ephemeral', 'dramatic', 'lucrative', 'pejorative', NULL, 'ok', NULL, NULL, NULL),
(597, '100208', 'The ______ of the wax museum''s statues astounded us; the Elvis sculpture appeared so lifelike that I half expected it to speak.', 'verisimilitude', 'integrity', 'placidity', 'fecundity', 'deviousness', 'ok', NULL, NULL, NULL, NULL),
(598, '100401', 'The precision and significant breadth of her revised essay showcased Latricia''s ______ writing skill, whereas her first draft was ______ and obviously rushed.', 'formidable…practiced', 'factual…thorough', 'linguistic…creative ', 'considerable…scattered', 'polished…effective', NULL, NULL, NULL, 'ok', NULL),
(599, '100402', 'One cannot help but be moved by Theresa''s ______ struggle to overcome a devastating and debilitating accident.', 'heartrending', 'provoked', 'belated', 'therapeutic', 'brief', 'ok', NULL, NULL, NULL, NULL),
(600, '100403', 'The Louvre museum houses many paintings that likely will never be ______, because the Louvre''s ownership rights to them are virtually ______. ', 'viewed…variable', 'released…incomprehensible', 'maintained…laudable', 'devalued…regrettable', 'transferred…inalienable', NULL, NULL, NULL, NULL, 'ok'),
(601, '100404', 'Lincoln made his Gettysburg Address concise by using only the most ______ language possible and by relying on the compact power of the few lines he chose to deliver.', 'celebratory', 'timorous', 'succinct ', 'solemn', 'glorious', NULL, NULL, 'ok', NULL, NULL),
(602, '100405', 'The evidence strongly suggested the suspect was guilty, but the jury found no such ______.', 'exoneration ', 'juxtaposition', 'acquittal', 'manifestation', 'culpability ', NULL, NULL, NULL, NULL, 'ok'),
(603, '100901', 'The environmental organization disagreed with David''s unsound proposal to use the local river as a dumping site for the chemical plant he managed; it claimed that his proposal would cause ______ of the local drinking water.', 'a dispersal', 'a purification', 'a contamination', 'an enforcement', 'a polarization', NULL, NULL, 'ok', NULL, NULL),
(604, '100902', 'To show them how to recognize when a thunderstorm was ______ and would soon strike, Mrs. Hauser taught her sixth-grade science students to spot cumulonimbus clouds, or thunderheads.', 'voluble', 'imminent ', 'saturating', 'mercurial', 'perilous', NULL, 'ok', NULL, NULL, NULL),
(605, '100903', 'The class thought the new student was ______: her haughty and dismissive attitude made many of her classmates angry.', 'opulent', 'conceded', 'arrogant ', 'ominous', 'agile', NULL, NULL, 'ok', NULL, NULL),
(606, '100904', 'When Helena won the worst Dressed Award at the Halloween party, she was utterly ______, because she hadn''t even worn costume.', 'attires', 'incompetent', 'obscured', 'mortified ', 'rambunctious', NULL, NULL, NULL, 'ok', NULL),
(607, '100905', 'Reacting to the chemical company''s several decades of ______ dumping industrial waste, the government has ordered a cleanup of Onondaga Lake; however, company executives counter that the ______ costs of a thorough cleanup will bankrupt them.', 'imprecise…fiscal', 'molecular…excessive', 'volatile…pecuniary', 'unconscionable…remunerative', 'indiscriminate…exorbitant', NULL, NULL, NULL, NULL, 'ok'),
(608, '100906', 'Despite mounting evidence that the researcher''s findings were faked, the researcher himself staunchly ______such claims.', 'verified', 'repudiated ', 'disseminated', 'embellished', 'insinuated', NULL, 'ok', NULL, NULL, NULL);
