(1, '1-1.1', 'B', NULL, '21与18最大公约数为3，则最小公倍数为21*18/3', NULL, NULL, NULL),
(2, '1-1.2', 'A', '18的因子为1,2,3,6,9,18；小于18的质数为2,3，5,7,11,13,17', NULL, NULL, NULL, NULL),
(3, '1-1.3', 'E', '设P=9X+4(X为整数），则P-4=9X能被9整除', 'P+5=9X+9=9(X+1)则能被9整除', 'P+2=9X+6=3(3X+2)则能被3整除', '9X+4=3（3X+1）+1，则除以3余数为1', '若X为偶数，9X+4能被2整除'),
(4, '1-1.4', 'D', NULL, NULL, NULL, '下一个4的倍数为（k-1)+4=k+3', NULL),
(5, '1-2.1', 'C', NULL, NULL, 'AD=2AB=24,AC=1/2AB=6,则CD=AC-AD=18', NULL, NULL),
(6, '1-2.2', 'E', '若B、D同侧，则BD=7-5=2', NULL, NULL, '若B、D异侧，则BD=7+5=12', NULL),
(7, '1-3.1', 'D', '15=2+13', '19=2+17', '22=17+5', '若俩奇质数相加，和为偶数则23不符；质数中有且只有偶数2,但23=21+2,21不为质数', '25=23+2'),
(8, '1-3.2', 'D', '若没有偶数，则乘积为奇数不为偶数', '若2个偶数2个奇数，则乘积与和均为偶数', '若4个偶数，乘积与和均为偶数', NULL, NULL),
(9, '1-3.3', 'C', '选项为偶数', '选项为偶数', '选项为奇数且大于0', '选项不一定大于0', '选项不一定为整数，且不一定大于0'),
(10, '1-3.4', 'B', '若X为偶数，X(X+4)为偶数', '若X为奇数，X(X+4)为奇数', NULL, NULL, NULL),
(11, '1-3.5', 'A', 'a^2于b^2均大于等于0，则化简得bc>0', NULL, NULL, NULL, NULL),
(12, '1-3.6', 'A', '2n-1为奇数，其平方亦为奇数', '选项等于（n+1)^2，为偶数', '选项为偶数', '选项为偶数', '选项奇偶性不可知'),
(13, '1-4.1', 'E', NULL, NULL, NULL, NULL, '968除以5的余数为3，则取第三个数字7'),
(14, '1-4.2', 'C', NULL, NULL, '式子无意义则分母为0,3X-1=0，则X=1/3', NULL, NULL),
(15, '1-5.1', 'D', NULL, NULL, NULL, 'X*40%*200%=Y*40%，则X=50%*Y', NULL),
(16, '1-5.2', 'C', NULL, NULL, '(1-20%)*(1+X)=100%,则X=25%', NULL, NULL),
(17, '1-5.3', 'C', NULL, NULL, '（1-25%）*（1-8%）=69%，相当于折扣31%', NULL, NULL),
(18, '1-6.1', 'A', '三项平均数为X+4=0，则X=-4', NULL, NULL, NULL, NULL),
(19, '1-7.1', 'E', NULL, NULL, NULL, NULL, 't和w为反比例关系，w''=5w，则t''=tw/(5w)=1/5t'),
(20, '1-7.2', 'B', NULL, '当x^2=3.7^2=13.69,y=24,则y=1.753x^2。则x=8.3时，y=1.753*8.3^2=120.77', NULL, NULL, NULL),
(21, '1-8.1', 'A', '选项=2a^(1/3)b^(2/3)', '选项=2a^(1/2)b^(3/2)', '选项=3a^(1/3)b^(2/3)', '选项=2a^(2/3)b^(2/3)', '选项=2a^(3/2)b');
