(37, '2015/9/9 0:00:00', 'E', NULL, NULL, NULL, NULL, '总数为（15+2）*3=51，CARMEN为51-12-15=24', 1, '统计'),
(38, '2015/9/10 0:00:00', 'B', NULL, '等边三角形中，半径OA=AB=10，则周长=2π*10=20π', NULL, NULL, NULL, 1, '几何'),
(39, '2015/9/11 0:00:00', 'D', NULL, NULL, NULL, 'a=-4,b=2，a/b有最小整数-2', NULL, 2, '算数'),
(40, '2015/9/12 0:00:00', 'A', '设处理了5x只鸟，则对应4x只猫，60x只狗，总共69x只动物位于200至250之间，则x=3，处理了15只鸟', NULL, NULL, NULL, NULL, 2, '算数'),
(41, '2015/9/13 0:00:00', 'D', NULL, NULL, NULL, 'x-y=-5,y-x=5', NULL, 1, '代数'),
(42, '2015/9/14 0:00:00', 'E', NULL, NULL, NULL, NULL, '如题可列式', 1, '应用题'),
(43, '2015/9/15 0:00:00', 'A', '2^x*4^（2x)=2^x*2^(4x)=2^(x+4x)=2^(5x)', NULL, NULL, NULL, NULL, 1, '算数'),
(44, '2015/9/16 0:00:00', 'A', 'πr^2*9+1/3πr^2*9=72,r=√6', NULL, NULL, NULL, NULL, 2, '几何');
